import React from 'react';
import Container from './Container.js'
import SmallContainer from './SmallContainer.js'
import CardTemplate from './CardTemplate.js'
import Header from './Header'
import H1 from './H1'
import Button from './Button'
import P from './P'
import Input from './Input'


class Create extends React.Component {
	render() {
		return(
			<Container border background>
				<Header width='100'>Create</Header>
				<CardTemplate>
					<SmallContainer width='200'>
						<H1>Don't be a stat sheet. Be a hero.</H1>

						<P>What name will they write in the books of legend?</P>	

						<input></input>

						<Button>Begin journey</Button>				
					</SmallContainer>
				</CardTemplate>

			</Container>
		);
	}

}

export default Create;
